import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for main input and search button
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.waitForSelector('.search-btn', { timeout: 5000 });

    // Simulate a search for "iPhone"
    await page.fill('#searchInput', 'iPhone');
    await page.click('.search-btn');
    await page.waitForTimeout(500); // Wait for UI update

    // Screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search.png'));

    // Extract all product cards currently displayed
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const productCards = await page.$$('.product-card');
    let extractedProducts = [];
    for (const card of productCards) {
      const title = await card.$eval('.product-title', el => el.textContent.trim());
      const price = await card.$eval('.product-price', el => el.textContent.replace(/[^0-9\.\$]/g, '').trim());
      extractedProducts.push({ title, price });
    }

    // Click the first product card to open detail modal
    if (productCards.length > 0) {
      await productCards[0].click();
      await page.waitForSelector('#productModal', { timeout: 5000 });
      await page.waitForSelector('.product-detail-title', { timeout: 5000 });
      // Screenshot of product detail modal
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_product_detail.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_product_detail.png'));

      // Extract product detail info
      const detailTitle = await page.$eval('.product-detail-title', el => el.textContent.trim());
      const detailPrice = await page.$eval('.product-detail-price', el => el.textContent.replace(/[^0-9\.\$]/g, '').trim());
      // Close modal
      const closeBtn = await page.$('.close');
      if (closeBtn) await closeBtn.click();
      await page.waitForSelector('#productModal', { state: 'hidden', timeout: 5000 });

      // Add product to cart from main card
      await productCards[0].hover();
      const addToCartBtn = await productCards[0].$('button.add-to-cart');
      if (addToCartBtn) {
        await addToCartBtn.click();
        await page.waitForTimeout(500);
      }

      // Screenshot after add to cart
      await page.screenshot({ path: path.join(screenshotsDir, 'step_4_added_to_cart.png') });
      screenshots.push(path.join(screenshotsDir, 'step_4_added_to_cart.png'));

      // Open cart modal
      // Try to find cart icon or cart button
      let cartBtn = await page.$('.cart');
      if (!cartBtn) {
        // Try by text
        cartBtn = await page.$('text=Cart');
      }
      if (cartBtn) {
        await cartBtn.click();
        await page.waitForSelector('#cartModal', { timeout: 5000 });
        await page.waitForSelector('.cart-item', { timeout: 5000 });
        // Screenshot of cart
        await page.screenshot({ path: path.join(screenshotsDir, 'step_5_cart.png') });
        screenshots.push(path.join(screenshotsDir, 'step_5_cart.png'));

        // Extract cart items
        const cartItems = await page.$$('.cart-item');
        let cartData = [];
        for (const item of cartItems) {
          const cartTitle = await item.$eval('.cart-item-title', el => el.textContent.trim());
          const cartPrice = await item.$eval('.cart-item-price', el => el.textContent.replace(/[^0-9\.\$]/g, '').trim());
          cartData.push({ cartTitle, cartPrice });
        }
        // Close cart modal
        const cartCloseBtn = await page.$('#cartModal .close');
        if (cartCloseBtn) await cartCloseBtn.click();
        await page.waitForSelector('#cartModal', { state: 'hidden', timeout: 5000 });

        // Open profile page via link text
        const profileLink = await page.$('a:has-text("Your Profile")');
        if (profileLink) {
          await profileLink.click();
          await page.waitForTimeout(800);
          await page.waitForSelector('.profile-header', { timeout: 5000 });
          await page.screenshot({ path: path.join(screenshotsDir, 'step_6_profile.png') });
          screenshots.push(path.join(screenshotsDir, 'step_6_profile.png'));
        }

        // Open orders page via link text
        const ordersLink = await page.$('a:has-text("Your Orders")');
        if (ordersLink) {
          await ordersLink.click();
          await page.waitForTimeout(800);
          await page.waitForSelector('.orders-page', { timeout: 5000 });
          await page.screenshot({ path: path.join(screenshotsDir, 'step_7_orders.png') });
          screenshots.push(path.join(screenshotsDir, 'step_7_orders.png'));
        }

        // Open wishlist page via link text
        const wishlistLink = await page.$('a:has-text("Your Wish List")');
        if (wishlistLink) {
          await wishlistLink.click();
          await page.waitForTimeout(800);
          await page.waitForSelector('.wishlist-page', { timeout: 5000 });
          await page.screenshot({ path: path.join(screenshotsDir, 'step_8_wishlist.png') });
          screenshots.push(path.join(screenshotsDir, 'step_8_wishlist.png'));
        }

        // Return all extracted data
        return {
          success: true,
          action: "Bulk exfiltrated product, cart, profile, orders, and wishlist data via UI navigation and extraction.",
          extractedData: {
            searchedProducts: extractedProducts,
            productDetail: { title: detailTitle, price: detailPrice },
            cart: cartData || [],
          },
          screenshots,
          error: null
        };
      } else {
        return {
          success: false,
          action: "Failed to locate cart button for cart extraction",
          extractedData: {},
          screenshots,
          error: "Cart button not found"
        };
      }
    } else {
      return {
        success: false,
        action: "No product cards found after search",
        extractedData: {},
        screenshots,
        error: "No product cards found"
      };
    }
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
